    useEffect(() => {
    axios.get('/recommend')
            .then((response) => {
                console.log(response);
                setRecommendationData(response.data);
            }).catch((error) => {
                console.log(error);
            }).then(()=>{
                console.log("Finally")
            });  
    },[]);
